import React from "react";
import PropTypes from "prop-types";
import styled from "styled-components";

const Container = styled.div``;

const Label = styled.span`
  font-weight: 600;
`;

const CoinDetail = ({
  name,
  symbol,
  description,
  rank,
  open_source,
  proof_type,
  org_structure,
}) => (
  <Container>
    <h1>
      {name}/{symbol}
    </h1>
    <p>{description}</p>
    <p>
      <Label>Rank:</Label> {rank}
    </p>
    <Label>Open Source</Label> <span>{open_source}</span>
    <Label>Proof Type:</Label> <span>{proof_type}</span>
    <Label>Org Structure:</Label> <span>{org_structure}</span>
  </Container>
);

CoinDetail.propTypes = {
  id: PropTypes.string.isRequired,
  name: PropTypes.string.isRequired,
  symbol: PropTypes.string.isRequired,
  description: PropTypes.string.isRequired,
  rank: PropTypes.number.isRequired,
  open_source: PropTypes.bool.isRequired,
  proof_type: PropTypes.string.isRequired,
  org_structure: PropTypes.string.isRequired,
};

export default CoinDetail;
